var myApp = new Framework7({
	modalTitle: 'Musicapp',
	animateNavBackIcon: true,
	swipeBackPage:false
});
var $$ = Dom7;
var mainView = myApp.addView('.view-main', {
	dynamicNavbar: true,
});
var rightView = myApp.addView('.view-right', {
	dynamicNavbar: true
});
